/*Table structure for table `t_match` */

DROP TABLE IF EXISTS `t_match`;

CREATE TABLE `t_match` (
  `match_id` varchar(25) NOT NULL COMMENT '比赛ID',
  `title` varchar(100) NOT NULL COMMENT '比赛名称',
  `level` int(11) DEFAULT NULL COMMENT '比赛等级(0:国家级/1:省级/2:校级)',
  `type` int(11) DEFAULT NULL COMMENT '比赛类型（0:个人/1:团队）',
  `application_form` varchar(255) DEFAULT NULL COMMENT '申请书',
  `time` varchar(32) DEFAULT NULL COMMENT '比赛时间',
  `cost` double(10,2) DEFAULT NULL COMMENT '费用',
  `invoice` varchar(255) DEFAULT NULL COMMENT '发票',
  `certificate` varchar(255) DEFAULT NULL COMMENT '证书',
  `state` int(11) DEFAULT NULL COMMENT '状态(1:进行中/2:已结束)',
  `reimbursement` int(11) DEFAULT NULL COMMENT '是否已报销（0否/1是）',
  PRIMARY KEY (`match_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='比赛_任务表';

