/*Table structure for table `t_postgraduate` */

DROP TABLE IF EXISTS `t_postgraduate`;

CREATE TABLE `t_postgraduate` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '考研ID',
  `user_id` int(11) NOT NULL COMMENT '考研人ID',
  `time` varchar(32) DEFAULT NULL COMMENT '报考时间',
  `school` varchar(75) DEFAULT NULL COMMENT '报考学校',
  `orientation` varchar(75) DEFAULT NULL COMMENT '报考方向',
  `exam` varchar(10) DEFAULT NULL COMMENT '统考成绩',
  `state` int(11) NOT NULL COMMENT '状态（0:正在考取/1:已完成）',
  `success` int(11) DEFAULT NULL COMMENT '通过状态(0:失败/1:成功)',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `考研人` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='考研人员表';

